import React, { useState } from "react";
import { FaSwimmer, FaFutbol, FaBasketballBall, FaTableTennis, FaMapMarkerAlt, FaCalendarAlt, FaSearch } from "react-icons/fa";

const SearchBar = () => {
  const [activity, setActivity] = useState("");
  const [location, setLocation] = useState("");
  const [date, setDate] = useState("");
  const [isOpen, setIsOpen] = useState(false);

  // Liste des activités avec leurs icônes
  const activities = [
    { value: "natation", label: "Natation", icon: <FaSwimmer className="text-blue-500" /> },
    { value: "football", label: "Football", icon: <FaFutbol className="text-green-500" /> },
    { value: "basketball", label: "Basketball", icon: <FaBasketballBall className="text-orange-500" /> },
    { value: "tennis", label: "Tennis", icon: <FaTableTennis className="text-red-500" /> },
  ];

  const handleSearch = () => {
    console.log("Recherche effectuée avec :", { activity, location, date });
    // Ajoutez ici la logique de recherche
  };

  return (
    <div className="bg-gray-900 text-white p-6 rounded-lg shadow-xl max-w-4xl mx-auto">
      <h2 className="text-2xl font-bold mb-4 text-center">Rechercher un terrain</h2>

      <div className="flex flex-col md:flex-row gap-4 items-center">
        {/* Sélecteur d'activité avec icône */}
        <div className="relative w-full md:w-1/3">
          <select
            value={activity}
            onChange={(e) => setActivity(e.target.value)}
            onFocus={() => setIsOpen(true)}
            onBlur={() => setTimeout(() => setIsOpen(false), 200)}
            className="border p-3 pl-10 rounded-lg w-full focus:outline-none focus:ring-2 focus:ring-emerald-500 cursor-pointer appearance-none bg-white text-gray-800"
          >
            <option value="">Activité</option>
            {activities.map((act) => (
              <option key={act.value} value={act.value}>
                {act.label}
              </option>
            ))}
          </select>
          {/* Icône affichée uniquement quand le menu est ouvert */}
          {isOpen && (
            <div className="absolute left-3 top-1/2 transform -translate-y-1/2 text-gray-500">
              {activities.find((act) => act.value === activity)?.icon}
            </div>
          )}
        </div>

        {/* Sélecteur de localisation avec icône */}
        <div className="relative w-full md:w-1/3">
          <FaMapMarkerAlt className="absolute left-3 top-1/2 transform -translate-y-1/2 text-gray-500" />
          <select
            value={location}
            onChange={(e) => setLocation(e.target.value)}
            className="border p-3 pl-10 rounded-lg w-full focus:outline-none focus:ring-2 focus:ring-emerald-500 cursor-pointer appearance-none bg-white text-gray-800"
          >
            <option value="">Localisation</option>
            <option value="tunis">Tunis</option>
            <option value="ariana">Ariana</option>
            <option value="ben_arous">Ben Arous</option>
            <option value="mannouba">Manouba</option>
          </select>
        </div>

        {/* Sélecteur de date avec icône */}
        <div className="relative w-full md:w-1/3">
          <FaCalendarAlt className="absolute left-3 top-1/2 transform -translate-y-1/2 text-gray-500" />
          <input
            type="date"
            value={date}
            onChange={(e) => setDate(e.target.value)}
            className="border p-3 pl-10 rounded-lg w-full focus:outline-none focus:ring-2 focus:ring-emerald-500 cursor-pointer bg-white text-gray-800"
          />
        </div>

        {/* Bouton de recherche */}
        <button
          onClick={handleSearch}
          className="bg-emerald-600 text-white px-6 py-3 rounded-lg hover:bg-emerald-500 transition-all duration-200 w-full md:w-auto flex items-center gap-2 justify-center"
        >
          <FaSearch /> Rechercher
        </button>
      </div>
    </div>
  );
};

export default SearchBar;
